  true,\n\t\"url\": null,\n\t\"notes\": \"Digital Audio Legal Recorder (DALR2), fac
  code CCB1, has the capability of recording up to 576 channels using multiple 24-channel
  audio interface boards and multiple recorder loggers.  There are a total of 144
  channels per logger.  The rack consists of a GPS converter, printer, inform server,
  KVM switch, workstation, up to four recorder loggers, and an optional UPS.  Various
  supporting components include a remote alarm relay unit, temperature sensor, and
  network routers complete the system main components.  The existing GPS recorder
  receiver and remote alarm unit will interface to the DALR2 system. Each rack of
  equipment is equivalent to one unit. (Source: FSEP Desk Guide)\",\n\t\"license_title\":
